import React from "react";

function Analytics() {
  return (
    <div>
      <p
        style={{
          color: "#5076FF",
          fontWeight: "600",
          fontSize: "2.5em",
          textAlign: "center",
          marginTop: "10vh",
        }}
      >
        Quiz Analysis
      </p>
      <p
        style={{
          width: "60vw",
          marginLeft: "10vw",
          marginRight: "10vw",
          color: "#FFFFFF",
          backgroundColor: "#5076FF",
          marginTop: "8vh",
          borderRadius: "10px",
          fontSize: "1.2em",
          paddingTop:"1.5vh",
          paddingBottom:"1.5vh",
          fontWeight: "600",
        }}
      >
        <span>S.No</span>
        <span>Quiz Name </span>
        <span>Created on</span>
        <span>Impression</span>
      </p>
    </div>
  );
}

export default Analytics;
